import * as React from 'react';
import Stack from '@mui/material/Stack';
import Button from '@mui/material/Button';
import Container from '@mui/material/Container';
import Typography from '@mui/material/Typography';


export default function AddDrugBtn() {
  return (
    <Container style={{ marginTop:'30px' , marginLeft:'0px'}}>
        <div>
          <h7 style={{marginBottom:'15px', }}>Add Drugs To the system which are available for the user to buy</h7>
          <Stack spacing={2} direction="row">
            <Button variant="contained">Add Drug</Button>
          </Stack>
        </div>
    </Container>
  );
}
